import { Navigate, Outlet } from "react-router-dom";
import { useAuth } from "../../pages/TokenContext";

export default function ProtectedRoutes({path}) {
  const { token, user } = useAuth();


  if (token) {
    return <Outlet />;
  } else {
    return <Navigate to={path} />;
  }

}
